    false,nt"url": null,nt"notes": "This dataset has verified (quality-controlled),
    hourly, water level (tide) datanfrom NOAA NOS Center for Operational Oceanographic
    Products and Servicesn(CO-OPS).   This is a delayed dataset, not a near-real-time
    dataset.nnWARNING:n* Queries for data MUST include stationID=, datum=, time>=, and
    time<=.n* Queries MUST be for less than 30 days worth of data.n* Different stations
    support different datums.n  Use ERDDAP's Subset web page to find out which datums
    a given station supports.n* The data source isn't completely reliable. If your request
    returns no datan  when you think it should:n  * Make sure the station you specified
    supports the datum you specified.n  * Try revising the request (e.g., a different
    datum or a different time range).n  * The list of stations offering this data (or
    the list of datums) may be incorrect.n  * Sometimes a station or the entire data
    service is unavailable.n    Wait a while and try again.",nt"license_title":
